import React from 'react';
import './works.css';
import portfolio1 from '../../assests/Images/portfolio1';
import portfolio2 from '../../assests/Images/portfolio2';
import portfolio3 from '../../assests/Images/portfolio3';
import portfolio4 from '../../assests/Images/portfolio4';
import portfolio5 from '../../assests/Images/portfolio5';




const Works = () => {
  return (
    <section id="works">
        <h2 className="workstitle">My Portfolio</h2>
        <span className='worksDesc'>Unwavering computer enthusiast with a relentless drive for learning, problem-solving, and innovation. I actively engage in the tech community while maintaining a pioneering spirit, seeking to contribute to the ever-evolving world of computing</span>
        <div className="worksImgs">
            <img src="" alt="" className="worksImg" />
            <img src="" alt="" className="worksImg" />
            <img src="" alt="" className="worksImg" />
            <img src="" alt="" className="worksImg" />
            <img src="" alt="" className="worksImg" />
            <img src="" alt="" className="worksImg" />

        </div>

    </section>
  )
}

export default Works;
